  public void sendMessageTranslateEsperanto(View view) {
  // Do something in response to button
    //Intent intent = new Intent(this, Eoen.class); //DisplayMessageActivity.class);
    EditText editText = (EditText) findViewById(R.id.edit_message);
    EditText editText2 = (EditText) findViewById(R.id.edit_message2);
    String message = editText.getText().toString();
    if (message.compareTo(donate) == 0) {
      editText.setText("");
      editText2.setText("");
    } else {
      try {
        editText2.setText(translateEsperanto(message));
      } catch (RuntimeException ee) {
    	editText2.setText("Untranslatable. Ne tradukebla.");
      }
      if ((!(editText.getText().toString().endsWith(" nul"))) &&
    	(textIn2.endsWith(" nul"))) textIn2 = textIn2.substring(0, 
    	textIn2.length() - 4);
      editText.setText(textIn2);
      if (editText2.getText().toString().equals("No text. Neniu teksto.")) editText.setText("");
    }
    //intent.putExtra(EXTRA_MESSAGE, message);
    //startActivity(intent);
  }
  
