  public static String upper(String s, int p) {
      // Change character at index p to uppercase:
      if (s.length() <= p) return s;
      return s.substring(0, p) + s.substring(p, p + 1).toUpperCase()
              + s.substring(p + 1);
  }

  public static String lower(String s, int p) {
      // Change character at index p to lowercase:
      if (s.length() <= p) return s;
      return s.substring(0, p) + s.substring(p, p + 1).toLowerCase()
              + s.substring(p + 1);
  }

