      firstLetter = indexAlphabet.indexOf(wd.substring(0, 1)) + 1; // First letter
      secondLetter = indexAlphabet.indexOf(wd.substring(1, 2)) + 1; // Second letter
      if (secondLetter < 1) secondLetter = 1;
