  public static String asteriskSeparate(String EOWd) {
      // Separate noun and adj suffixes with asterisks:
      int p;
      // Skip non-nouns ending with -o and non-adjectives ending with -a:
      if (" la¯ da¯ kaj¯ tra¯ ja¯ do¯ pro¯ tro¯ ajn¯ po¯ ho¯ ba¯ ha¯ ".contains(" "
              + EOWd + " ")) {
          return EOWd.substring(0, EOWd.length() - 1);
      }
      // Non-separables:
      if (EOWd.endsWith("miliono¯")) {
          return EOWd.substring(0, EOWd.length() - 1);
      }
      if (EOWd.endsWith("miliardo¯")) {
          return EOWd.substring(0, EOWd.length() - 1);
      }
      if (EOWd.endsWith("milionoj¯")) {
          return EOWd.substring(0, EOWd.length() - 1);
      }
      if (EOWd.endsWith("miliardoj¯")) {
          return EOWd.substring(0, EOWd.length() - 1);
      }
      p = EOWd.indexOf("o¯");
      if (p != NOT_FOUND) {
          return EOWd.substring(0, p) + "*o";
      }
      p = EOWd.indexOf("oj¯");
      if ((p != NOT_FOUND)) {
          return EOWd.substring(0, p) + "*o*j";
      }
      p = EOWd.indexOf("on¯");
      if (p != NOT_FOUND) {
          return EOWd.substring(0, p) + "*o*n";
      }
      p = EOWd.indexOf("ojn¯");
      if (p != NOT_FOUND) {
          return EOWd.substring(0, p) + "*o*j*n";
      }
      p = EOWd.indexOf(ADJECTIVE_PLURAL_ORIG);
      if ((p != NOT_FOUND)) {
          return EOWd.substring(0, p) + "*a";
      }
      p = EOWd.indexOf(ADJECTIVE_PLURAL_ORIG);
      if ((p != NOT_FOUND)) {
          return EOWd.substring(0, p) + "*a*j";
      }
      p = EOWd.indexOf("an¯");
      if ((p != NOT_FOUND)) {
          return EOWd.substring(0, p) + "*a*n";
      }
      p = EOWd.indexOf("ajn¯");
      if ((p != NOT_FOUND)) {
          return EOWd.substring(0, p) + "*a*j*n";
      }
      return EOWd.substring(0, EOWd.length() - 1);
  }

  public static String conjugatePreterite(String entry) { // Conjugate preterite verb:
      String insertK;
      int x, g;
      String b = entry;
      int p = b.indexOf("*}");
      b = b.substring(0, p) + "/" + b.substring(p); // Add end delimiter
      int h = b.indexOf(DIV);
      boolean gf = false;
      p = -5;
      while ((p = b.indexOf("/", p + 5)) >= FOUND) {
          // Look for irregular verb infinitives to change to preterites:
          for (x = 0; x <= totalIrregularVerbs; x++) {
              gf = false;
              insertK = englishRoots[x];
              g = b.indexOf(englishRoots[x] + "/", h);
              if (p - insertK.length() >= FOUND) {
                  if (b.substring(p - insertK.length(), p).equals(insertK)) {
                      b = b.substring(0, p - insertK.length()) + englishPreterites[x]
                              + b.substring(p);
                      p = p - englishRoots[x].length() + englishPreterites[x].length();
                      gf = true;
                      break;
                  }
              }
          }
          do { // Look for regular verb infinitives to change to preterites
            if (gf) {
                gf = false;
                break;
            }
            insertK = "";
            if ((esperantoConsonants.contains(b.substring(p - 1, p)))
                    && (VOWELS.contains(b.substring(p - 2, p - 1)))
                    && (VOWELS.indexOf(b.substring(p - 3, p - 2)) == NOT_FOUND)) {
                insertK = b.substring(p - 1, p);
                if (insertK.equals("c")) {
                    insertK = "k"; // panic > panicked
                }
            }
            b = b.substring(0, p) + insertK + "ed" + b.substring(p);
            if (b.substring(p - 1, p).equals(ADVERB_MARKER_LC)) {
                b = b.substring(0, p - 1) + b.substring(p);
                p--;
            }
            if (b.substring(p - 1, p).equals("y")) {
                b = b.substring(0, p - 1) + "i"
                        + b.substring(p); // y -> ie
            }
            if (" ai ei oi ui ".indexOf(" " + b.substring(p - 2, p) + " ") >= FOUND) {
              b = b.substring(0, p - 1) + "y" + b.substring(p);
              break;
            }
          } while (false);
      }
      p = b.indexOf("/*}");
      b = b.substring(0, p) + b.substring(p + 1);
      b = b.replace("relaid", "relayed"); // Corrections
      b = b.replace("delaid", "delayed");
      return b;
  }

