  public static String conjugatePastParticiple(String entry) {
      // Conjugate past participle:
      // For appending -k after final -c before suffix: panic > panicked:
      String insertK, EnglishRoot;
      int i, g;
      String ent = entry;  // entry with Esperanto and English
      int endDelim = ent.indexOf("*}");
      // Insert final alternate translation delimiter:
      ent = ent.substring(0, endDelim) + "/" + ent.substring(endDelim);
      endDelim = ent.indexOf("/"); // Find first alternate translation delimiter
      int divider = ent.indexOf(DIV); // Find divider between Esperanto and English
      boolean gf = false;
      while (endDelim >= FOUND) {
          i = 0;
          do { // Look for irregular verb infinitives to change to past participles
              gf = false;
              EnglishRoot = englishRoots[i];
              g = ent.indexOf(englishRoots[i] + "/", divider);
              if (endDelim - EnglishRoot.length() >= 0) {
                  if (ent.substring(endDelim - EnglishRoot.length(),
                          endDelim).equals(EnglishRoot)) {
                      ent = ent.substring(0, endDelim - EnglishRoot.length())
                              + englishPastParticiples[i] + ent.substring(endDelim);
                      endDelim = endDelim - englishRoots[i].length()
                              + englishPastParticiples[i].length();
                      gf = true;
                      break;
                  }
              }
              i++;
          } while (i <= totalIrregularVerbs);
          do { // Look for regular verb infinitives to change to past participles
            if (gf) {
                gf = false;
                break;
            }
            insertK = "";
            if ((esperantoConsonants.contains(ent.substring(endDelim - 1, endDelim)))
              && (VOWELS.contains(ent.substring(endDelim - 2, endDelim
              - 1))) && (VOWELS.indexOf(ent.substring(endDelim - 3, endDelim
              - 2)) == NOT_FOUND)) {
              insertK = ent.substring(endDelim - 1, endDelim);
              // panic > panicked; picnic > picnicked:
              if (insertK.equals("c")) {
                  insertK = "k";
              }
            }
            ent = ent.substring(0, endDelim) + insertK + "ed" + ent.substring(endDelim);
            if (ent.substring(endDelim - 1, endDelim).equals("e")) {
                // Remove silent -e:
                ent = ent.substring(0, endDelim - 1) + ent.substring(endDelim);
                endDelim--;
            }
            if (ent.substring(endDelim - 1, endDelim).equals("y")) {
                ent = ent.substring(0, endDelim - 1) + "i" + ent.substring(endDelim); // -y + ed > -ied
            }
            // but not after vowels:
            if (" ai ei oi ui ".indexOf(" " + ent.substring(endDelim - 2, endDelim) + " ") >= FOUND) {
              ent = ent.substring(0, endDelim - 1) + "y" + ent.substring(endDelim);
              break;
            }
          } while (false);
          if (endDelim + 5 < ent.indexOf("*}"))
          {
            endDelim = ent.indexOf("/", endDelim + 5);
          }
          else
          {
            endDelim = NOT_FOUND;
          }
      }
      endDelim = ent.indexOf("/*}");
      ent = ent.substring(0, endDelim) + ent.substring(endDelim + 1);
      ent = ent.replace("relaid", "relayed"); // Corrections
      ent = ent.replace("delaid", "delayed");
      return ent;
  }

  public static String conjugateActivePassiveParticiples(String entry) {
      // Passive and active participles and other verbal suffixes
      String b = entry;
      int p = b.indexOf("*I", 2); // EO verb
      if ((p > EXISTS) && ((b.contains(ADJECTIVE_ENDING))
              || (b.contains(ADVERB_ENDING)))) {
          if ((b.contains("*it*a*"))) { // EO past passive participle
              b = conjugatePastParticiple(cutTo(b));
          } else if ((b.contains("*at*a*"))) { // EO present passive participle
              b = conjugatePastParticiple(cutTo(b));
              p = b.indexOf(DIV) + 3;
              b = b.substring(0, p) + "cuxxently|" + b.substring(p);
          } else if ((b.contains("*ot*a*"))) { // EO future passive participle
              b = conjugatePastParticiple(cutTo(b));
              p = b.indexOf(DIV) + 3;
              b = b.substring(0, p) + "going-to-be-" + b.substring(p);
              // EO conditional passive participle:
          } else if ((b.contains("*ut*a*"))) {
              b = conjugatePastParticiple(cutTo(b));
              p = b.indexOf(DIV) + 3;
              b = b.substring(0, p) + "would-be-" + b.substring(p);
          } else if ((b.contains("*ant*a*")) && (!(b.contains("_ing")))) {
              // EO present active participle adjective:
              b = affix(b, "", "_ing*}");
              // EO present active participle adverb:
          } else if ((b.contains("*ant*e*"))) {
              b = affix(b, "", "_ingly*}");
              // EO future active participle adverb:
          } else if ((b.contains("*ont*e*"))) {
              b = affix(b, "about|to|", "*}");
          } else if ((b.contains("*il*o*"))) { // EO tool verbal suffix
              b = affix(b, "", "_ing-tool*}");
          } else if ((b.contains("*int*a*"))) { // EO past active particip adj
              if (perfect) {
                  b = conjugatePastParticiple(cutTo(b));
              } else {
                  b = affix(b, "having|been|", "_ing*}");
              }
          } else if ((b.contains("*int*e*"))) { // EO past active particip adv
              b = affix(b, "having|", "_ed*}");
          } else if ((b.contains("*ont*a*"))) { // EO future active particip adj
              b = affix(b, "going-to-be-", "_ing*}");
              // EO conditional active participle adj:
          } else if ((b.contains("*unt*a*"))) {
              b = affix(b, "that|would-be-", "_ing*}");
          } else if (b.contains("*ebl*a*")) { // EO -able/-ible
              b = cutTo(b);
              if (! b.contains("_able")) b = affix(b, "", "_able*}");
          } else if ((b.contains("*ebl*e*"))) { // EO -ably/-ibly
              b = affix(b, "", "_ably*}");
          } else if ((b.contains("*end*a*"))) { // EO to be verbed
              b = affix(b, "to-be-", "_ed*}");
          } else if ((b.contains("*ind*a*"))) { // EO worthy to be verbed
              b = affix(b, "worthy-of-being-", "_ed*}");
          } else if ((b.contains("*em*a*"))) { // EO tending to
              p = b.length() - 3;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 2) + b.substring(p + 5);
              while ((!b.substring(p, p + 3).equals(DIVIDER)) && (p > 0)) {
                  p--;
              }
              b = b.substring(0, p + 4) + "tending-to-" + b.substring(p + 4, p
                      + 7).toLowerCase() + b.substring(p + 7);
          } else if ((b.contains("*iv*a*"))) { // EO able to
              p = b.length() - 3;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 2) + b.substring(p + 5);
              while ((!b.substring(p, p + 3).equals(DIVIDER)) && (p > 0)) {
                  p--;
              }
              b = b.substring(0, p + 4) + "able-to-" + b.substring(p + 4);
          } else if ((b.contains("*pov*a*"))) { // EO able to
              p = b.length() - 3;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 2) + b.substring(p + 5);
              while ((!b.substring(p, p + 3).equals(DIVIDER)) && (p > 0)) {
                  p--;
              }
              b = b.substring(0, p + 4) + "able-to-" + b.substring(p + 4);
          } else if ((b.contains("*vol*a*"))) { // EO wanting to
              p = b.length() - 3;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 2) + b.substring(p + 5);
              while ((!b.substring(p, p + 3).equals(DIVIDER)) && (p > 0)) {
                  p--;
              }
              b = b.substring(0, p + 4) + "wanting-to-" + b.substring(p + 4);
          } else if ((b.contains("*kapabl*a*"))) { // EO capable of
              p = b.length() - 5;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 2) + b.substring(p + 5);
              while ((!b.substring(p, p + 3).equals(DIVIDER)) && (p > 0)) {
                  p--;
              }
              b = b.substring(0, p + 4) + "capable-of-" + b.substring(p + 4);
              b = b.substring(0, b.length() - 2) + "_ing*}";
          }
          // EO like above but to be since derived from adj:
      } else if (b.indexOf("*A") > EXISTS) {
          if ((b.contains("*em*a*"))) {
              b = verbalAdjective(b, "tending-to-be|");
          } else if ((b.contains("*iv*a*"))) {
              b = verbalAdjective(b, "able-to-be|");
          } else if ((b.contains("*pov*a*"))) {
              b = verbalAdjective(b, "able-to-be|");
          } else if ((b.contains("*vol*a*"))) {
              b = verbalAdjective(b, "wanting-to-be|");
          } else if ((b.contains("*kapabl*a*"))) {
              b = verbalAdjective(b, "capable-of-being|");
          }
      }
      // tool:
      if ((p >= 0) && ((b.contains(NOUN_ENDING))
              || (b.contains(ADJECTIVE_ENDING)))) {
          if ((b.contains("*il*o*"))) {
              b = b.substring(0, b.length() - 2) + "_ing-tool*}"; // EO tool noun
              p = b.length() - 8;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 1) + NOUN_MARKER + b.substring(p + 5);
          } else if ((b.contains("*il*a*"))) { // EO tool adj
              b = b.substring(0, b.length() - 2) + "_ing-tool*}";
              p = b.length() - 8;
              while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
                  p--;
              }
              b = b.substring(0, p + 1) + ADJECTIVE_MARKER + b.substring(p + 5);
          }
      }
      return b;
  }

  public static String verbalAdjective(String entry, String suffix) {
      // Add adjective suffixes to verb stems:
      p = entry.length() - 4;
      while ((!entry.substring(p - 1, p + 2).equals(DIVIDER)) && (p > START)) {
          p--;
      }
      return entry.substring(0, p + 3) + suffix + entry.substring(p + 3);
  }

