  public static int verbPosition(int nn) { // Find verb position
      int wordPs;
      int n = nn;
      String ent = nextWord(n + 1);
      if (!t.substring(nearbyWordIndex - 1, nearbyWordIndex).equals(" ")) {
          return -1;
      }
      if ((!t.substring(nearbyWordIndex - 2, nearbyWordIndex - 1).equals(" "))
              && (!t.substring(nearbyWordIndex - 2, nearbyWordIndex - 1).equals("}"))
              && (!t.substring(nearbyWordIndex - 2, nearbyWordIndex - 1).equals(","))) {
          return -1;
      }
      wordPs = nearbyWordIndex;
      if ((!(ent.contains("i*¯"))) || (ent.contains(PRONOUN_ENDING))
              || (ent.contains("i*¯*N"))) {
          ent = nextWord(n);
          wordPs = nearbyWordIndex;
      }
      n--;
      if ((!(ent.contains("nt*a*¯"))) && (!(ent.contains("nt*a*j*¯")))
              && (!(ent.contains("nta*¯"))) && (!(ent.contains("ntaj*¯")))
              && ((!(ent.contains("i*¯"))) || (ent.contains(PRONOUN_ENDING))
              || (ent.contains("i*¯*N")))) {
          wordPs = 0;
      }
      if (n == 0) {
          currentWordIndex = -1;
          nearbyWordIndex = -1;
          ent = nextWord(-1);
      } else {
          ent = nextWord(n);
      }
      if (!t.substring(nearbyWordIndex - 1, nearbyWordIndex).equals(" ")) {
          return -1;
      }
      if (nearbyWordIndex > 1) {
          if ((!t.substring(nearbyWordIndex - 2, nearbyWordIndex - 1).equals(" ")) && 
            (!t.substring(nearbyWordIndex - 2, nearbyWordIndex - 1).equals("}")) && 
            (!t.substring(nearbyWordIndex - 2, nearbyWordIndex - 1).equals(","))) {
              return -1;
          }
      }
      if (wordPs >= 0) {
          wordPs -= nearbyWordIndex;
      }
      return wordPs;
  }

