  public static String cutTo(String ee) {
      // Remove infinitive To:
      if ((ee.indexOf("to|") == NOT_FOUND) && (ee.indexOf("To|") == NOT_FOUND)) {
          return ee;
      }
      String e = ee;
      int p = e.length() - 7;
      while ((!e.substring(p, p + 3).equals("to|")) && (!e.substring(p, p
              + 3).equals("To|"))) {
          p--;
      }
      return e.substring(0, p) + e.substring(p + 3);
  }

  public static String affix(String entry, String prefix, String suffix) {
      // Add English verb suffixes and prefixes:
      String b = entry.substring(0, entry.length() - 2) + suffix + "*}";
      p = b.length() - 8;
      while ((!b.substring(p, p + 1).equals("*")) && (p > 2)) {
          p--;
      }
      if (b.substring(p + 2, p + 5).equals("To|")) {
          if (prefix.length() == 0) {
              b = b.substring(0, p + 2) + b.substring(p + 5, p + 6).toUpperCase() + b.substring(p + 6);
          } else {
              b = b.substring(0, p + 2) + b.substring(p + 5);
              prefix = prefix.substring(0, 1).toUpperCase() + prefix.substring(1);
          }
      } else {
          b = b.substring(0, p + 2) + b.substring(p + 5);
      }
      if (prefix.length() != 0) {
          while ((!b.substring(p, p + 3).equals(DIVIDER)) && (p > START)) {
              p--;
          }
          b = b.substring(0, p + 4) + prefix + b.substring(p + 4);
      }
      return b;
  }

