  public static void addOneSuffix(String s) {
      // Add EO and English suffixes to list:
      esperanto = "*" + esperantoWords[x] + "*" + s + esperanto;
      english = "*" + englishTranslations[x] + english;
      entry = esperanto + DIV + english;
  }

  public static boolean addPrefix(String w, String f, String esperantoPrefix,
          String englishPrefix) {
      // Search for and add prefixes:    
      if (w.startsWith(esperantoPrefix)) {
          if (wordPrefix(w.substring(esperantoPrefix.length()),
                  esperantoPrefix.length() + f)) {
              esperanto = "*" + esperantoPrefix + esperanto;
              english = englishPrefix + english;
              return true;
          }
      }
      return false;
  }

  public static boolean wordPrefix(String w, String f) {
      // Prefix search:
      for (int x = 0; x <= totalPrefixes; x++) {
          if (addPrefix(w, f, esperantoPrefixes[x], "*" + englishPrefixes[x])) { // f = parts of speech found
              return true;
          }
      }
      return wordStem(w, f);
  }

