  public static boolean wordStem(String w, String f) {
      // Word stem search
      int x, y;
      String st, st2, ps; 
      if (w.length() < 3) {
          return wordSuffix(w, f); // f = parts of speech found
      }
      x = indexAlphabet.indexOf(w.substring(0, 1)) + 1;
      y = indexAlphabet.indexOf(w.substring(1, 2)) + 1;
      if (x * y < 4) {
          return false;
      }
      x = (x - 2) * 25 + y - 1;
      x = Integer.parseInt(dictionaryIndex.substring(x * 4, x * 4 + 4), 16);
      if (x == 0xffff) {
          return wordSuffix(w, f);
      }
      x--;
      do {
          do {
              ps = englishTranslations[x].substring(0, 1);
              st = esperantoWords[x];
              if (w.startsWith(st)) {
                  st2 = "|" + st + "|";
                  if (w.length() >= st.length() + 1) {
                      if ((w.substring(st.length(), st.length() + 1).equals("x"))) {
                          x = x - 1;
                          if (x >= 0) {
                              break;
                          } else {
                              return wordSuffix(w, f);
                          }
                      }
                  }

                  if (wordStem(w.substring(st.length()), f + ps)) {
                      esperanto = "*" + st + esperanto;
                      addFrequentSuffixes(x, true);
                      return true;
                  }
                  if (w.length() >= st.length() + 1) {
                      if ((w.substring(st.length(), st.length() + 1).equals("o"))
                              && ((ps.equals("O")) || (ps.equals("I")))) {
                          if (wordStem(w.substring(st.length() + 1), f + ps)) {
                              esperanto = "*" + st + esperanto;
                              addFrequentSuffixes(x, false);
                              return true;
                          }
                      }
                  }
                  if (w.length() >= st.length() + 1) {
                      if ((w.substring(st.length(), st.length() + 1).equals("i"))
                              && (ps.equals("I"))) {
                          if (wordStem(w.substring(st.length() + 1), f + ps)) {
                              esperanto = "*" + st + esperanto;
                              addFrequentSuffixes(x, false);
                              return true;
                          }
                      }
                  }
                  if (w.length() >= st.length() + 1) {
                      if ((w.substring(st.length(), st.length() + 1).equals("a"))
                              && ((ps.equals("A")) || (ps.equals("O")))) {
                          if (wordStem(w.substring(st.length() + 1), f + ps)) {
                              esperanto = "*" + st + esperanto;
                              addFrequentSuffixes(x, false);
                              return true;
                          }
                      }
                  }
                  if (w.length() >= st.length() + 1) {
                      if ((w.substring(st.length(), st.length() + 1).equals("e"))
                              && ((ps.equals("E")) || (ps.equals("F")))) {
                          if (wordStem(w.substring(st.length() + 1), f + ps)) {
                              esperanto = "*" + st + esperanto;
                              addFrequentSuffixes(x, false);
                              return true;
                          }
                      }
                  }
              }
              x = x - 1;
              if (x < 0) {
                  if (wordSuffix(w, f)) {
                      return true;
                  }
                  return false;
              }
          } while (false);
      } while ((esperantoWords[x].substring(0, 2).compareTo(w.substring(0, 2))
              >= 0) && (x >= 0));
      if (wordSuffix(w, f)) {
          return true;
      }
      return false;
  }

