  public static String trim(String st) { // Remove leading and trailing spaces
      int p = 0;
      int e = st.length() - 1;
      while (st.substring(p, p + 1) == " ") {
          p++;
      }
      while (st.substring(e, e + 1) == " ") {
          e--;
      }
      return st.substring(p, e + 1);
  }

  public static String leftTrim(String st) { // Remove leading spaces
      int p = 0;
      while (st.substring(p, p + 1) == " ") {
          p++;
      }
      return st.substring(p);
  }

  public static String rightTrim(String st) { // Remove trailing spaces
      int p = st.length();
      int n = 0;
      if (p >= 1) {
          while ((st.substring(p - 1, p).equals("\n")) && (p > 1)) {
              n++;
              p--;
          }
          while (st.substring(p - 1, p).equals(" ")) {
              p--;
          }
          if ((n > 0) && (n < 37)) {
              return st.substring(0, p) + ("\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n"
              + "\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n").substring(0, n); // Restore newlines
          }
      }
      return st.substring(0, p);
  }

  public static String verbChange(String s, String oldVerb, String newVerb) {
      // Changes verb phrases such as idioms, including inflexions:
      String oldPhrase = "";
      int p = oldVerb.indexOf(" ");
      if (p >= FOUND) {
          oldPhrase = oldVerb.substring(p);
          oldVerb = oldVerb.substring(0, p);
      }
      oldVerb = " " + oldVerb;
      String newPhrase = "";
      p = newVerb.indexOf(" ");
      if (p >= FOUND) {
          newPhrase = newVerb.substring(p);
          newVerb = newVerb.substring(0, p);
      }
      newVerb = " " + newVerb;
      if ((oldVerb.endsWith("e")) && (newVerb.endsWith("e"))) { // Silent -e at end of both verbs
        oldVerb = oldVerb.substring(0, oldVerb.length() - 1);
        newVerb = newVerb.substring(0, newVerb.length() - 1);
        return s.replaceAll(oldVerb.substring(0, 2).toLowerCase() + oldVerb.substring(2) + 
        "(e|es|ed|ing)(ly)?(erly)?" + oldPhrase + "([ .,?!:;)])", newVerb.substring(0, 2).toLowerCase() + 
        newVerb.substring(2) + "$1$2$3" + newPhrase + "$4").replaceAll(oldVerb.substring(0, 2).toUpperCase() + 
        oldVerb.substring(2) + "(e|es|ed|ing)(ly)?(erly)?" + oldPhrase + "([ .,?!:;)])", newVerb.substring(0,
        2).toUpperCase() + newVerb.substring(2) + "$1$2$3" + newPhrase + "$4");
      } else {
        return s.replaceAll(oldVerb.substring(0, 2).toLowerCase() + oldVerb.substring(2) + 
        "(s|ed|ing)?(ly)?(erly)?" + oldPhrase + "([ .,?!:;)])", newVerb.substring(0, 2).toLowerCase() + 
        newVerb.substring(2) + "$1$2$3" + newPhrase + "$4").replaceAll(oldVerb.substring(0, 2).toUpperCase() 
        + oldVerb.substring(2) + "(s|ed|ing)?(ly)?(erly)?" + oldPhrase + "([ .,?!:;)])", newVerb.substring(0,
        2).toUpperCase() + newVerb.substring(2) + "$1$2$3" + newPhrase + "$4");
      }
  }
  
